import React, {useState, useEffect} from 'react';
import { Link } from 'react-router-dom'
import { connect } from 'react-redux';

const Navbar = (props) => {
    const [cartItems, setCartItems] = ueState()
    return (
        <nav className="nav-wrapper">
            <div className="container">
                <Link to="/" className="brand-logo">Shopping</Link>

                <ul className="right">
                    <li><Link to="/">Shop</Link></li>
                    <li ><Link to="/cart" className='cartCustomStyle'>My cart <i className="material-icons">shopping_cart</i><span>{props.addItems}</span></Link></li>
                </ul>
            </div>
        </nav>


    )
}

export default connect(
    (state) => ({
        cartItems: state.addItems
    })
)(Navbar);
